import React from 'react';

const Services = () => {
  const services = [
    { title: "Web Development", desc: "Innovative software solutions tailored to move your business forward." },
    { title: "App Development", desc: "Native and cross-platform mobile solutions." },
    { title: "Product Strategy", desc: "Strategic planning to help your business scale." },
    { title: "Custom Software", desc: "Tailored software built for your specific needs." },
    { title: "UI/UX Design", desc: "Clean design that turns complex ideas into seamless solutions." },
    { title: "Post-Launch Support", desc: "Ensuring your digital products stay efficient and updated." }
  ];

  return (
    <section id="services" style={{ background: '#f8f9fa' }}>
      <div className="container">
        <h2>Our Services</h2>
        [cite_start]<p className="section-subtitle">Innovative software solutions tailored to move your business forward[cite: 25].</p>
        <div style={styles.grid}>
          {services.map((s, index) => (
            <div key={index} style={styles.card}>
              <div style={styles.icon}>{`</>`}</div>
              <h3>{s.title}</h3>
              <p style={{ color: '#666' }}>{s.desc}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

const styles = {
  grid: { display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', gap: '30px' },
  card: { background: '#fff', padding: '30px', borderRadius: '10px', boxShadow: '0 5px 15px rgba(0,0,0,0.05)', transition: '0.3s' },
  icon: { fontSize: '2rem', color: '#2ecc71', marginBottom: '15px', fontWeight: 'bold' }
};

export default Services;
